import axios from "axios"




const API_KEY = "441b46165ac2d0aea117cda3d2fae79b"
const URL = "https://api.openweathermap.org/data/2.5/weather"

const Fetch = async (Query) => {
    let { data } = await get.axios(URL, {
        params:
            Q = Query,
        units: "metric",
        API_KEY: API_ID
    })
    return data


